import styled from 'styled-components';

export const PortfolioText=styled.p`
  border-bottom: 0.5px solid #f2f2f2;
  font-family: BerkeleyStd;
  font-size: 24px;
  line-height: 1.25;
  letter-spacing: 0.5px;
  color: #022737;
  padding: 10px;
`;

export const TitleText=styled.p`
  font-family: HelveticaNeue;
  font-size: 16px;
  font-weight: bold;
  line-height: 1.5;
  color: #022737;
  /* margin: 0px; */
`;

export const PortfolioValuesWrapper=styled.div`
    display: flex;
    justify-content: flex-start;
    border-bottom: 0.5px solid #f2f2f2;
`;

export const Values=styled.div`
    width: 33%;
`;

export const IndividualBuilderTitle=styled.p`
  font-family: HelveticaNeue;
  margin: 0px;
  font-size: 16px;
  line-height: 1.5;
  color: #505050;
`;

export const IndividualBuilderValue=styled.p`
    font-family: HelveticaNeue;
  font-size: 16px;
  font-weight: bold;
  line-height: 1.5;
  color: #022737;    
`;
